window.bookSummaryJSON = "<p>If we were as tiny as ants to another being, what would they make of our philosophies? The great satirist Voltaire imagines alien visitors who have opinions.&nbsp;&nbsp;</p> <p>Bedtime stories are narrated by the world's most celebrated voices and written with no beginning, middle, or end so you don't stay up to hear what happens next. They're interesting enough to give your mind something to focus on, but delivered in a way that encourages sleep.&nbsp;</p> <p>This title is part of The Audible Sleep Collection, exclusive audio experiences created to invite relaxation and sleep. New and free for members.</p>"; 
